import react, { Fragment } from 'react';

const Pregunta = () => {
	return (
		<Fragment>
            <h2>Coloca tu presupuesto</h2>
            <form>
                <input
                    type="number"
                    className="u-full-width"
                    placeholder="Colaca tu presupuesto"
                />

                <input
                    type="submit"
                    className="butto-primary u-full-width"
                    value="Definir Presupuesto"
                />
            </form>
		</Fragment>
	);
};

export default Pregunta;
